import logo from './logo.svg';
import './App.css';
export default App;

function mousel() {
  if (onclick) {
    return(<button>oui</button>)
  } else {
    return(<p>non</p>)
  }
}
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          <code>Bienvenue</code>
          <mousel/>
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React 
        </a>
      </header>
    </div>
  );
}
